Jason Scott Lee and Lauren Holly star in this unforgettable glimpse into the life, love, and the unconquerable spirit of the legendary Bruce Lee.

From a childhood of rigorous martial arts training, Lee realizes his dream of opening his own kung-fu school in America.

Before long, he is discovered by a Hollywood producer and begins a meteoric rise to fame and an all too short reign as one of the most charismatic action heroes in motion picture history.
